import "./header.css"
export default function Header(){
    return(
        <div className="header">
            <div className="headerTitles">
                <span className="headerTitleBlog">Blog</span>
                <span className="headerTitleCook">Nấu Ăn</span>
            </div>
            <img className="headerImg" src="" alt=""/>
        </div>
    );
}
